const Home = () => {
  return (
    <div style={{ padding: '1rem', textAlign: 'center' }}>
      <h2>Welcome to Truth Engine</h2>
      <img
        src={image1}
        alt="Truth Engine Visual"
        style={{
          maxWidth: '100%',
          height: 'auto',
          marginTop: '1rem',
          borderRadius: '12px',
          boxShadow: '0 2px 8px rgba(0,0,0,0.1)'
        }}
      />
    </div>
  );
};

export default Home;
